const REPO   = 'wr98-code/new-zeromeridian';
const TOKEN  = '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';
const BRANCH = 'main';
const BASE   = 'https://api.github.com';
const H = {
  'Authorization': `token ${TOKEN}`,
  'Content-Type':  'application/json',
  'User-Agent':    'zeromeridian-push',
};

async function sha(path) {
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}?ref=${BRANCH}`, { headers: H });
  if (!r.ok) return null;
  return (await r.json()).sha ?? null;
}

async function push(path, b64) {
  const existing = await sha(path);
  const body = {
    message: `push88: Bloomberg-grade overhaul — ${path}`,
    content: b64,
    branch:  BRANCH,
    ...(existing ? { sha: existing } : {}),
  };
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}`, {
    method:  'PUT',
    headers: H,
    body:    JSON.stringify(body),
  });
  const data = await r.json();
  if (!r.ok) throw new Error(`${path}: ${data.message}`);
  return data;
}

